import React, { Component } from 'react';
import { Link } from 'react-router-dom';


class AdminBio extends Component {
    render() {
        return (
            <div className="admin-bio">
                <Link to="/admin">Back to projects</Link>     
            </div>
        )
    }
}

export default AdminBio;
